import { AddColor } from "./AddColor";
import "./App.css";
import { Counter } from "./Counter";
import { Routes, Route, Link } from "react-router-dom";

const INITIAL_MOVIE_LIST = [
  {
    name: "Bridgerton",
    poster: "http://image.tmdb.org/t/p/original//luoKpgVwi1E5nQsi7W0UuKHu2Rq.jpg",
    rating: 4,
    trailer: "https://youtu.be/gpv7ayf_tyE",
    summary: "Bridgerton follows Daphne Bridgerton (Phoebe Dynevor), the eldest daughter of the powerful Bridgerton family as she makes her debut onto Regency London's competitive marriage market. Hoping to follow in her parent's footsteps and find a match sparked by true love, Daphne's prospects initially seem to be unrivaled.",
    cast: {
      actor: "Nicola Coughlan",
      actress: "Claudia Jessie",
    },
    duration: "60min",
  },
  {
    name: "Lucifer",
    poster: "http://image.tmdb.org/t/p/original//ekZobS8isE6mA53RAiGDG93hBxL.jpg",
    rating: 4.7,
    trailer: "https://youtu.be/X4bF_quwNtw",
    summary: "Lucifer Morningstar (Tom Ellis) is the devil. He's tired of Hell and takes a break in L.A. He's running his nightclub Lux with demon disciple Mazikeen (Lesley-Ann Brandt). His brother Amenadiel (D.B. Woodside) demands that he returns to Hell.",
    cast: {
      actor: "Tom Ellis",
      actress: "Lauren German",
    },
    duration: "100min",
  },
  {
    name: "Bridgerton",
    poster: "http://image.tmdb.org/t/p/original//luoKpgVwi1E5nQsi7W0UuKHu2Rq.jpg",
    rating: 5,
    trailer: "https://youtu.be/gpv7ayf_tyE",
